import React from 'react';
import 'bootstrap/dist/css/bootstrap.min.css'; // Importa Bootstrap CSS
import '../Style/Header.css'; // Asegúrate de que la ruta sea correcta
import logo from '../images/logo.png';

const Header = () => {
  return (
    <header className="custom-header-bg text-white py-2 fixed-top"> {/* Clase fixed-top de Bootstrap */}
      <div className="container">
        <div className="d-flex align-items-center">
          {/* Logo */}
          <img src={logo} alt="Logo" className="header-logo me-3 ml-adj" /> {/* Clase adicional para margen izquierdo */}
          {/* Texto */}
          <div>
            <span className="h4 mb-0">CONECTA</span>
            <br />
            <span className="h6 mb-0">Electrical Automation Solutions</span>
          </div>
        </div>
      </div>
    </header>
  );
};

export default Header;
